import XCTest
@testable import StringFeeder

final class StringFeederTests: XCTestCase {
    var sut: Feeder!
    
    override func setUpWithError() throws {
        sut = Feeder()
    }
    
    override func tearDownWithError() throws {
        sut = nil
    }
    
    func testShouldThrowForbiddenCharsError() throws {
        // given:
        let parameters = [
            Feeder.Parameter(name: "string value", value: Feeder.Value.string("very cool string"))
        ]
        
        // when:
        do {
            _ = try sut.feed(parameters: parameters, into: "")
        } catch {
            // then
            guard let error = error as? Feeder.FeedingError else {
                XCTFail("Should have thrown Feeding Error.")
                return
            }
            switch error {
            case let .containsForbiddenCharacter(field):
                XCTAssertEqual(field, "string value")
            default: XCTFail("Wrong error thrown.")
            }
            return
        }
        
        XCTFail("Should have thrown an error.")
    }
    
    func testShouldThrowForbiddenKeyError() throws {
        // given:
        let parameters = [
            Feeder.Parameter(name: "ifSet", value: Feeder.Value.string("very cool string"))
        ]
        
        // when:
        do {
            _ = try sut.feed(parameters: parameters, into: "")
        } catch {
            // then
            guard let error = error as? Feeder.FeedingError else {
                XCTFail("Should have thrown Feeding Error.")
                return
            }
            switch error {
            case let .keyForbidden(field):
                XCTAssertEqual(field, "ifSet")
            default: XCTFail("Wrong error thrown.")
            }
            return
        }
        
        XCTFail("Should have thrown an error.")
    }
    
    func testShouldThrowForbiddenKeyIfNotSetError() throws {
        // given:
        let parameters = [
            Feeder.Parameter(name: "ifNotSet", value: Feeder.Value.string("very cool string"))
        ]
        
        // when:
        do {
            _ = try sut.feed(parameters: parameters, into: "")
        } catch {
            // then
            guard let error = error as? Feeder.FeedingError else {
                XCTFail("Should have thrown Feeding Error.")
                return
            }
            switch error {
            case let .keyForbidden(field):
                XCTAssertEqual(field, "ifNotSet")
            default: XCTFail("Wrong error thrown.")
            }
            return
        }
        
        XCTFail("Should have thrown an error.")
    }
    
    func testSimpleStringFeed() throws {
        // given:
        let testString = "This is some $string_value."
        let parameters = [
            Feeder.Parameter(name: "string_value", value: Feeder.Value.string("very cool string"))
        ]
        
        // when:
        let result = try sut.feed(parameters: parameters, into: testString)
        
        // then:
        XCTAssertEqual(result, "This is some very cool string.")
    }
    
    func testSimpleIntegerFeed() throws {
        // given:
        let testString = "This is some $int_value."
        let parameters = [
            Feeder.Parameter(name: "int_value", value: Feeder.Value.integer(5))
        ]
        
        // when:
        let result = try sut.feed(parameters: parameters, into: testString)
        
        // then:
        XCTAssertEqual(result, "This is some 5.")
    }
    
    func testSimpleMultipleFeed() throws {
        // given:
        let testString = "This is some $int_value. It will also be here $int_value. And the string will be \"$string_value\""
        let parameters = [
            Feeder.Parameter(name: "int_value", value: Feeder.Value.integer(5)),
            Feeder.Parameter(name: "string_value", value: Feeder.Value.string("very cool string"))
        ]
        
        // when:
        let result = try sut.feed(parameters: parameters, into: testString)
        
        // then:
        XCTAssertEqual(result, "This is some 5. It will also be here 5. And the string will be \"very cool string\"")
    }
    
    func testEscaping() throws {
        // given:
        let testString = "This is some \\$int_value. It will also be here $int_value. And the string will be \"$string_value\""
        let parameters = [
            Feeder.Parameter(name: "int_value", value: Feeder.Value.integer(5)),
            Feeder.Parameter(name: "string_value", value: Feeder.Value.string("very cool string"))
        ]
        
        // when:
        let result = try sut.feed(parameters: parameters, into: testString)
        
        // then:
        XCTAssertEqual(result, "This is some $int_value. It will also be here 5. And the string will be \"very cool string\"")
    }
    
    func testDifferentIndicator() throws {
        // given:
        sut = Feeder(parameterIndicator: .percent)
        let testString = "This is some \\%int_value. It will also be here %int_value. And the string will be \"%string_value\""
        let parameters = [
            Feeder.Parameter(name: "int_value", value: Feeder.Value.integer(5)),
            Feeder.Parameter(name: "string_value", value: Feeder.Value.string("very cool string"))
        ]
        
        // when:
        let result = try sut.feed(parameters: parameters, into: testString)
        
        // then:
        XCTAssertEqual(result, "This is some %int_value. It will also be here 5. And the string will be \"very cool string\"")
    }
    
    func testSimpleStringWithBrackets_ShouldNotReplace() throws {
        // given:
        let testString = "This is some $string_value(\"with some\",\"nichts\"."
        let parameters = [
            Feeder.Parameter(name: "string_value", value: Feeder.Value.string("very cool string"))
        ]
        
        // when:
        let result = try sut.feed(parameters: parameters, into: testString)
        
        // then:
        XCTAssertEqual(result, "This is some very cool string(\"with some\",\"nichts\".")
    }
    
    func testOnePlaceholderCreatesTheOtherOne() throws {
        // given:
        let testString = "$test_two_params"
        let parameters = [
            Feeder.Parameter(name: "test_two", value: Feeder.Value.string("$new")),
            Feeder.Parameter(name: "new_params", value: Feeder.Value.string("test"))
        ]
        
        // when:
        let result = try sut.feed(parameters: parameters, into: testString)
        
        // then:
        XCTAssertEqual(result, "test")
    }
    
    func testComments() throws {
        // given
        let testString = "Test string with # comment at the end of the line\nTest string # with comment # in between\nTest string # with comment where the \\# other one is escaped.\nTest string where \\# the first one # is escaped.\nTest string with # comment at the end of the line"
        let resultString = "Test string with \nTest string  in between\nTest string \nTest string where # the first one \nTest string with "
        
        // when
        let result = try sut.feed(parameters: [], into: testString)
        
        // then
        XCTAssertEqual(result, resultString)
    }
    
    func testNestedBracketsWithoutAnyContent() throws {
        // given
        let testString = "Test(string(with(some ( nested \n ) $brackets ) that ) should )) be ) in ) the ) ignored"
        
        // when
        let result = try sut.feed(parameters: [
            Feeder.Parameter(name: "brackets", value: .string("brackets"))
        ], into: testString)
        
        // then
        XCTAssertEqual(result, "Test(string(with(some ( nested \n ) brackets ) that ) should )) be ) in ) the ) ignored")
    }
    
    func testSomeGoodExample() throws {
        // given
        let testString = "Dear $name,\n\nwe just want to inform you that your order $ifSet(order_number; \"with order number $order_number \"; \")was shipped to your address.\n\nPlease consider checking it upon arrival.\n\nYour Customer Support\n$should_show_ad(\"# will show an add if should show add is set to true.\nHave you heard about our new product?\n\"; \"\")"
        
        // when
        let result = try sut.feed(parameters: [
            Feeder.Parameter(name: "name", value: .string("John Doe")),
            Feeder.Parameter(name: "order_number", value: .integer(12345654321)),
            Feeder.Parameter(name: "should_show_ad", value: .boolean(true))
        ], into: testString)
        
        // then
        XCTAssertEqual(result, "Dear John Doe,\n\nwe just want to inform you that your order with order number 12345654321 was shipped to your address.\n\nPlease consider checking it upon arrival.\n\nYour Customer Support\n\nHave you heard about our new product?\n")
    }
    
